// SPDX-License-Identifier: BUSL-1.1

pragma solidity ^0.8.17;
import {AccessControl} from "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract AcUpgradable is AccessControl, Ownable, Initializable {
    // 0xcb58d6d985142a614029cdf01861b4fe094d5919a47e69b8310dc4093d9d6ad0
    bytes32 internal constant ROLE_CONTROLLER = keccak256("ROLE_CONTROLLER");
    // 0x241ecf16d79d0f8dbfb92cbc07fe17840425976cf0667f022fe9877caa831b08
    bytes32 internal constant MANAGER_ROLE = keccak256("MANAGER_ROLE");
    // 0xfb248bbb6ca5a799a6bb9ba79f58aa5cdbe0e5979238a967315e7ffbfd119d1a
    bytes32 internal constant ROLE_POS_KEEPER = keccak256("ROLE_POS_KEEPER");
    //======================
    // 0x5d8e12c39142ff96d79d04d15d1ba1269e4fe57bb9d26f43523628b34ba108ec
    bytes32 internal constant WITHDRAW_ROLE = keccak256("WITHDRAW_ROLE");
    //======================
    // 0x8d1089725c0dc266707fa6207730fb801dcd03108bfed7a21099bd303651d2b7
    bytes32 internal constant MARKET_MGR_ROLE = keccak256("MARKET_MGR_ROLE");
    // 0x275a642cf55cb12407e505ec86398168f240e88df6e66d1649bd09de9071c5db
    bytes32 internal constant GLOBAL_MGR_ROLE = keccak256("GLOBAL_MGR_ROLE");

    // 0xcb6bc1c12dd43bca8d7dd46d975f913325437d0dcd5978e99d515e4ad39b9772
    bytes32 internal constant VAULT_MGR_ROLE = keccak256("VAULT_MGR_ROLE");

    // 0x92de27771f92d6942691d73358b3a4673e4880de8356f8f2cf452be87e02d363
    bytes32 internal constant FREEZER_ROLE = keccak256("FREEZER_ROLE");

    // 0x59c7a9ef9a56707d87d116a5d27496afee2604c70b902ac2c4dbdcb68f36f2ea
    // bytes32 internal constant FEE_DISTRIBUTOR_ROLE = keccak256("FEE_DISTRIBUTOR_ROLE");

    // 0xf21b97e3e053faeacb5e76d16d9daf713b69d060518bccb2c9ee13a7f9cfc49f
    bytes32 internal constant FEE_MGR_ROLE = keccak256("FEE_MGR_ROLE");
    // 0xf7650eb8b2f3fb3c9b995a8ee2fc3c04ed07f1c4efe01998177b109698c67517
    bytes32 internal constant PRICE_UPDATE_ROLE =
        keccak256("PRICE_UPDATE_ROLE");

    // 0xde57aa0116fb656e0ab30962f03bb7a49dccfb8fac7bf6a5cf94d0d56d0e7337
    bytes32 internal constant MULTI_SIGN_ROLE = keccak256("MULTI_SIGN_ROLE");

    uint256 private initBlock;

    modifier onlyInitOr(bytes32 _role) {
        bool isDefaultAdmin = hasRole(DEFAULT_ADMIN_ROLE, _msgSender());
        if (isDefaultAdmin) {
            if (block.timestamp - initBlock >= 3600 * 24 * 7)
                revert("ac time passed");
        } else {
            _checkRole(_role, _msgSender());
        }
        _;
    }

    function _initialize(address _f) internal {
        initBlock = block.timestamp;
        _transferOwnership(_msgSender());

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(DEFAULT_ADMIN_ROLE, _f);
    }

    function transferAdmin(address to) external onlyRole(DEFAULT_ADMIN_ROLE) {
        _setupRole(DEFAULT_ADMIN_ROLE, to);
        _transferOwnership(to);
        _revokeRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    modifier onlyAdmin() {
        _checkRole(MANAGER_ROLE);
        _;
    }

    modifier onlyFreezer() {
        _checkRole(FREEZER_ROLE);
        _;
    }

    modifier onlyPositionKeeper() {
        _checkRole(ROLE_POS_KEEPER);
        _;
    }

    modifier onlyController() {
        _checkRole(ROLE_CONTROLLER);
        _;
    }

    modifier onlyUpdater() {
        require(hasRole(PRICE_UPDATE_ROLE, msg.sender));
        _;
    }

    function grantControllerRoleByMarketManager(
        address _account
    ) external onlyRole(MARKET_MGR_ROLE) {
        require(supportMarketRoleGrantControllerRole());
        _grantRole(ROLE_CONTROLLER, _account);
    }

    function supportMarketRoleGrantControllerRole()
        internal
        pure
        virtual
        returns (bool)
    {
        return false;
    }
}

contracts/fee/FeeRouter.sol.content:
// SPDX-License-Identifier: BUSL-1.1
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import {SafeCast} from "@openzeppelin/contracts/utils/math/SafeCast.sol";
import {AcUpgradable} from "../ac/AcUpgradable.sol";

import {IFundFee} from "./interfaces/IFundFee.sol";
import {IFeeVault} from "../interfaces/fee/IFeeVault.sol";
import {MarketDataTypes} from "../market/MarketDataTypes.sol";
import {Position} from "../position/PositionStruct.sol";
import {TransferHelper} from "./../utils/TransferHelper.sol";
import "../market/interfaces/IMarketFactory.sol";

import "./interfaces/IFeeRouter.sol";
import {Precision} from "../utils/TransferHelper.sol";
import "./lib/FeeRouterLib.sol";

interface IMarket {
    function feeRouter() external returns (IFeeRouter);
}

contract FeeRouter is AcUpgradable, IFeeRouter {
    using SafeERC20 for IERC20;
    using SafeCast for int256;
    using SafeCast for uint256;
    using MarketDataTypes for int256[];

    address public feeVault;
    address public fundFee;
    address public factory;

    uint256 public constant FEE_RATE_PRECISION = Precision.FEE_RATE_PRECISION;

    // market's feeRate and fee
    mapping(address => mapping(uint8 => uint256)) public feeAndRates;

    event UpdateFee(
        address indexed account,
        address indexed market,
        int256[] fees,
        uint256 amount
    );
    event UpdatePayoutFee(
        address indexed account,
        address indexed market,
        int256[] fees,
        uint256 amount
    );
    event UpdateFeeAndRates(
        address indexed market,
        uint8 kind,
        uint256 oldFeeOrRate,
        uint256 feeOrRate
    );

    modifier onlyMarket() {
        require(_isMarket(msg.sender), "invalid market");
        _;
    }

    modifier onlyFeeController() {
        require(
            _isMarket(msg.sender) || hasRole(ROLE_CONTROLLER, msg.sender),
            "feeRouter: access denied"
        );
        _;
    }

    function initialize(
        address _factory,
        address vault,
        address fundingFee
    ) external initializer {
        require(_factory != address(0), "invalid address");
        require(vault != address(0), "invalid fee vault");
        require(fundingFee != address(0), "invalid fundFee");
        AcUpgradable._initialize(_factory);
        factory = _factory;
        feeVault = vault;
        fundFee = fundingFee;
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(MANAGER_ROLE, msg.sender);
    }

    function setFeeVault(address vault) external onlyAdmin {
        require(vault != address(0), "invalid fee vault");
        feeVault = vault;
    }

    function setFundFee(address fundingFee) external onlyAdmin {
        require(fundFee != address(0), "invalid fundFee");
        fundFee = fundingFee;
    }

    function setFeeAndRates(
        address market,
        uint256[] memory rates
    ) external onlyInitOr(MARKET_MGR_ROLE) {
        require(rates.length > 0, "invalid params");

        for (uint8 i = 0; i < rates.length; i++) {
            uint256 _old = rates[i];
            feeAndRates[market][i] = rates[i];
            emit UpdateFeeAndRates(market, i, _old, rates[i]);
        }
    }

    function migrateFeeAndRates(
        address market,
        uint8 _len
    ) external onlyInitOr(MARKET_MGR_ROLE) {
        IFeeRouter fr = IMarket(market).feeRouter();
        for (uint8 i = 0; i < _len; i++) {
            uint256 _old = fr.feeAndRates(market, i);
            feeAndRates[market][i] = _old;
            emit UpdateFeeAndRates(market, i, _old, _old);
        }
    }

    function withdraw(
        address token,
        address to,
        uint256 amount
    ) external onlyRole(WITHDRAW_ROLE) {
        IFeeVault(feeVault).withdraw(token, to, amount);
    }

    /**
     * @dev Updates the cumulative funding rate for a specific market.
     * Only the controller can call this function.
     * @param market The address of the market.
     * @param longSize The size of the long position.
     * @param shortSize The size of the short position.
     */
    function updateCumulativeFundingRate(
        address market,
        uint256 longSize,
        uint256 shortSize
    ) external onlyMarket {
        IFundFee(fundFee).updateCumulativeFundingRate(
            market,
            longSize,
            shortSize
        );
    }

    /**
     * @dev Collects fees from the sender and increases the fees in the fee vault for the specified account.
     * Only the controller can call this function.
     * @param account The account to increase fees for.
     * @param token The address of the token to collect fees in.
     */
    function collectFees(
        address account,
        address token,
        int256[] memory fees
    ) external onlyFeeController {
        _collectFees(account, token, fees, 0);
    }

    function collectFees(
        address account,
        address token,
        int256[] memory fees,
        uint256 fundfeeLoss
    ) external onlyFeeController {
        _collectFees(account, token, fees, fundfeeLoss);
    }

    function _collectFees(
        address account,
        address token,
        int256[] memory fees,
        uint256 fundfeeLoss
    ) private {
        uint256 _amount = IERC20(token).allowance(msg.sender, address(this));
        // todo 会存在这种现象嘛 如果存在要不要更新event
        //if (_amount == 0 && fundfeeLoss == 0) return;
        if (_amount != 0)
            IERC20(token).safeTransferFrom(msg.sender, feeVault, _amount);
        if (fundfeeLoss > 0)
            IFundFee(fundFee).addFeeLoss(msg.sender, fundfeeLoss);
        emit UpdateFee(account, msg.sender, fees, _amount);
    }

    function payoutFees(
        address account,
        address token,
        int256[] memory fees,
        uint256 feesTotal
    ) external onlyFeeController {
        uint256 _amount = IERC20(token).balanceOf(feeVault);
        if (_amount > feesTotal) _amount = feesTotal;
        IFeeVault(feeVault).withdraw(token, msg.sender, _amount);
        emit UpdatePayoutFee(account, msg.sender, fees, _amount);
    }

    /**
     * @dev Retrieves the execution fee for a specific market.
     * @param market The address of the market.
     * @return The execution fee for the market.
     */
    function getExecFee(address market) external view returns (uint256) {
        return feeAndRates[market][uint8(FeeRouterLib.FeeType.ExecFee)];
    }

    /**
     * @dev Retrieves the funding rate for a specific market and position.
     * @param market The address of the market.
     * @param isLong A flag indicating whether the position is long (true) or short (false).
     * @return The funding rate for the market and position.
     */
    function getFundingRate(
        address market,
        bool isLong
    ) external view returns (int256) {
        return IFundFee(fundFee).getFundingRate(market, isLong);
    }

    /**
     * @dev Retrieves the cumulative funding rates for a specific market and position.
     * @param market The address of the market.
     * @param isLong A flag indicating whether the position is long (true) or short (false).
     * @return The cumulative funding rates for the market and position.
     */
    function cumulativeFundingRates(
        address market,
        bool isLong
    ) external view returns (int256) {
        return IFeeVault(feeVault).cumulativeFundingRates(market, isLong);
    }

    /**
     * @dev Retrieves the total fees for an order by calculating the trade fee and adding it to the execution fee.
     * @param params The parameters of the order.
     * @return fees The total fees for the order.
     */
    function getOrderFees(
        MarketDataTypes.UpdateOrderInputs memory params
    ) external view returns (int256 fees) {
        uint8 _kind;

        if (params.isOpen) {
            _kind = uint8(FeeRouterLib.FeeType.OpenFee);
        } else {
            _kind = uint8(FeeRouterLib.FeeType.CloseFee);
        }

        uint256 _tradeFee = FeeRouterLib.getFee(
            params._market,
            params._order.size,
            _kind,
            feeAndRates
        );
        uint256 _execFee = feeAndRates[params._market][
            uint8(FeeRouterLib.FeeType.ExecFee)
        ];
        return (_tradeFee + _execFee).toInt256();
    }

    /**
     * @dev Retrieves the fees associated with updating a position.
     * @param params The parameters of the position update.
     * @param position The properties of the position.
     * @return fees An array of fees for each fee type.
     */
    function getFees(
        MarketDataTypes.UpdatePositionInputs memory params,
        Position.Props memory position
    ) external view returns (int256[] memory fees) {
        return
            FeeRouterLib.getFees(
                params,
                _getFundingFee(
                    params._market,
                    params._isLong,
                    position.size,
                    position.entryFundingRate
                ),
                feeAndRates
            );
    }

    /**
     * @dev Calculates the funding fee for a given position update.
     * @param market The address of the market.
     * @param isLong A flag indicating whether the position is long (true) or short (false).
     * @param sizeDelta The change in position size.
     * @param entryFundingRate The funding rate at the entry of the position.
     * @return The funding fee for the position update.
     */
    function _getFundingFee(
        address market,
        bool isLong,
        uint256 sizeDelta,
        int256 entryFundingRate
    ) private view returns (int256) {
        return
            IFundFee(fundFee).getFundingFee(
                market,
                sizeDelta,
                entryFundingRate,
                isLong
            );
    }

    function _isMarket(address _market) private view returns (bool) {
        IMarketFactory.Outs[] memory _markets = IMarketFactory(factory)
            .getMarkets();
        uint _cnt = _markets.length;

        for (uint i = 0; i < _cnt; i++) {
            if (_market == _markets[i].addr) {
                return (_markets[i].allowOpen || _markets[i].allowClose);
            }
        }
        return false;
    }

    uint256[50] private ______gap;
}

