        if (originFundFee <= 0)
            require(originFundFee == afterFundFee, "!input");
        if (originFundFee > 0)
            require(originFundFee >= afterFundFee, "!input2");
        feeloss = (originFundFee - afterFundFee).toUint256();
        if (afterFundFee < 0) realPayout = (-afterFundFee).toUint256();
    } */
}

