// SPDX-License-Identifier: BUSL-1.1
pragma solidity ^0.8.17;
pragma experimental ABIEncoderV2;

import {IPositionBook} from "../position/interfaces/IPositionBook.sol";
import "../order/OrderLib.sol";
import {Order} from "../order/OrderStruct.sol";

library MarketDataTypes {
    using Order for Order.Props;
    using MarketDataTypes for MarketDataTypes.UpdatePositionInputs;

    //***************************************************
    //        UpdateOrderInputs
    //***************************************************

    struct UpdateOrderInputs {
        address _market;
        bool _isLong;
        uint256 _oraclePrice;
        bool isOpen;
        bool isCreate;
        Order.Props _order;
        uint256[] inputs;
        // Sub-index meanings:
        // 0: Amount to pay (pay)
        // 1: Is transaction from market (isFromMarket)
        // 2: Slippage value (_slippage)
    }

    function isFromMarket(
        UpdateOrderInputs memory _params
    ) internal pure returns (bool) {
        return _params.inputs.length >= 2 && _params.inputs[1] > 0;
    }

    function setIsFromMarket(
        UpdateOrderInputs memory _params,
        bool _p
    ) internal pure {
        _params.inputs[1] = _p ? 1 : 0;
    }

    function slippage(
        UpdateOrderInputs memory _params
    ) internal pure returns (uint256) {
        return _params.inputs.length >= 3 ? _params.inputs[2] : 0;
    }

    function setSlippage(
        UpdateOrderInputs memory _params,
        uint256 _p
    ) internal pure {
        _params.inputs[2] = _p;
    }

    //***************************************************
    //        UpdatePositionInputs
    //***************************************************

    struct UpdatePositionInputs {
        address _market;
        bool _isLong;
        uint256 _oraclePrice;
        bool isOpen;
        //===========
        address _account;
        uint256 _sizeDelta;
        uint256 _price;
        uint256 _slippage;
        bool _isExec;
        uint8 liqState;
        uint64 _fromOrder;
        bytes32 _refCode;
        uint256 collateralDelta;
        uint8 execNum;
        //***************************************************
        //        Definition of values in inputs
        //***************************************************
        // Add-Position meanings:
        // 0: Take Profit (TP)
        // 1: Stop Loss (SL)
        // 2: Keep leverage when the Take Profit order is triggered (0 for false, 1 for true)
        // 3: Keep leverage when the Stop Loss order is triggered (0 for false, 1 for true)

        // Sub-position meanings:
        // 0: Is Keep Leverage (isKeepLev); 1 for true, 0 for false;
        uint256[] inputs;
        //***************************************************
    }

    uint256 constant ADD_POS_KEEP_LEVERAGE_ON_TAKE_PROFIT = 2;
    uint256 constant ADD_POS_KEEP_LEVERAGE_ON_STOP_LOSS = 3;

    //===============================
    function initialize(
        UpdateOrderInputs memory _params,
        bool isOpen
    ) internal pure {
        _params.inputs = new uint256[](3);
        _params.isOpen = isOpen;
    }

    function initialize(
        UpdatePositionInputs memory _params,
        bool isOpen
    ) internal pure {
        //tp,sl
        //isKeeplev
        _params.inputs = new uint256[](4);
        _params.isOpen = isOpen;
        // _params.collateralDeltaPositive = true;
    }

    function fromOrder(
        UpdatePositionInputs memory _vars,
        Order.Props memory _order,
        address market,
        bool isLong,
        bool isIncrease,
        bool isExec
    ) internal pure {
        _vars._market = market;
        _vars._isLong = isLong; //
        _vars._sizeDelta = _order.size; //
        _vars._price = _order.price; //
        _vars._refCode = _order.refCode; //
        _vars._isExec = isExec;
        _vars._fromOrder = _order.orderID;
        _vars._account = _order.account; //
        _vars.collateralDelta = _order.collateral;
        if (isIncrease) {
            _vars.setTp(_order.getTakeprofit()); //
            _vars.setSl(_order.getStoploss()); //
            _vars.setKeepLeverageOnTakeProfit(_order.getKeepLevOnTP());
            _vars.setKeepLeverageOnStopLoss(_order.getKeepLevOnSL());
        } else {
            _vars.setIsKeepLev(_order.getIsKeepLev());
            if (!_order.getIsKeepLev()) _vars.collateralDelta = 0;
        }
    }

    //===============================
    //       tp & iskepp lev
    //===============================

    function tp(
        UpdatePositionInputs memory _params
    ) internal pure returns (uint256) {
        return _params.inputs.length >= 1 ? _params.inputs[0] : 0;
    }

    function setTp(
        UpdatePositionInputs memory _params,
        uint256 _tp
    ) internal pure {
        _params.inputs[0] = _tp;
    }

    function isKeepLev(
        UpdatePositionInputs memory _params
    ) internal pure returns (bool) {
        return _params.inputs.length >= 1 && _params.inputs[0] > 0;
    }

    function setIsKeepLev(
        UpdatePositionInputs memory _params,
        bool _is
    ) internal pure returns (uint256) {
        return _params.inputs[0] = _is ? 1 : 0;
    }

    //===============================
    //       sl
    //===============================

    function sl(
        UpdatePositionInputs memory _params
    ) internal pure returns (uint256) {
        return _params.inputs.length >= 2 ? _params.inputs[1] : 0;
    }

    function setSl(
        UpdatePositionInputs memory _params,
        uint256 _sl
    ) internal pure {
        _params.inputs[1] = _sl;
    }

    //=============================================================
    //       keep Leverage On TakeProfit/SL
    //=============================================================
    function keepLeverageOnTakeProfit(
        UpdatePositionInputs memory _params
    ) internal pure returns (bool) {
        return
            _params.inputs.length >= ADD_POS_KEEP_LEVERAGE_ON_TAKE_PROFIT + 1 &&
            _params.inputs[ADD_POS_KEEP_LEVERAGE_ON_TAKE_PROFIT] > 0;
    }

    function setKeepLeverageOnTakeProfit(
        UpdatePositionInputs memory _params,
        bool _is
    ) internal pure {
        _params.inputs[ADD_POS_KEEP_LEVERAGE_ON_TAKE_PROFIT] = _is ? 1 : 0;
    }

    function keepLeverageOnStopLoss(
        UpdatePositionInputs memory _params
    ) internal pure returns (bool) {
        return
            _params.inputs.length >= ADD_POS_KEEP_LEVERAGE_ON_STOP_LOSS + 1 &&
            _params.inputs[ADD_POS_KEEP_LEVERAGE_ON_STOP_LOSS] > 0;
    }

    function setKeepLeverageOnStopLoss(
        UpdatePositionInputs memory _params,
        bool _is
    ) internal pure {
        _params.inputs[ADD_POS_KEEP_LEVERAGE_ON_STOP_LOSS] = _is ? 1 : 0;
    }

    //===============================
    //       PAY
    //===============================
    function pay(
        UpdateOrderInputs memory _params
    ) internal pure returns (uint256) {
        return _params.inputs.length >= 1 ? _params.inputs[0] : 0;
    }

    function setPay(
        UpdateOrderInputs memory _params,
        uint256 _p
    ) internal pure {
        _params.inputs[0] = _p;
    }

    //===============================
    function isValid(
        UpdatePositionInputs memory /* _params */
    ) internal pure returns (bool) {
        // if (_params._account == address(0)) return false;
        // return true;
        // if (_params._account == address(0)) return false;
        // return _params.inputs.length == (_params.isOpen ? 2 : 1);
        return true;
    }

    function isValid(
        UpdateOrderInputs memory _params
    ) internal pure returns (bool) {
        //
        // if (false == _params.isOpen) {
        //     if (_params.inputs.length != 0) return false;
        // } else {
        //     if (_params.inputs.length != 1) return false;
        // }

        if (_params._oraclePrice > 0) return false;

        // close order
        if (false == _params.isOpen) {
            if (_params.isCreate) {
                // from order
                if (_params._order.getFromOrder() > 0) return false;
                //close: order to order id
                if (_params._order.extra2 > 0) return false;
            }
        } else {
            // collateral
            // if (_params._order.collateral > 0) return false;
        }

        // // // empty or order-order-id

        return true;
    }

    function totoalFees(
        int256[] memory fees
    ) internal pure returns (int256 total) {
        for (uint i = 0; i < fees.length; i++) {
            total += fees[i];
        }
    }
}

